window.bookSummaryJSON = "<p>Skeeve has decided, at long last, to come out of his self-imposed retirement and get back into the problem-solving biz. He confidently expected walk in and take his rightful place as the head of M.Y.T.H., Inc. He didn’t expect to have to face off against Aahz for the job. With their friends lending help but showing no favorites, they start a not-so-friendly contest to see who will run the company by taking opposite sides of the next case to walk in the door. Will the legendary partnership survive the battle, or will this be the end of a beautiful friendship?</p>"; 
